September is #SuicidePreventionMonth, a good reminder to check on loved ones. We can all play a role in preventing suicide and providing resources for those struggling.

Call or text 988 to reach the Suicide & Crisis Lifeline for free, confidential help 24/7.
@988Lifeline

I was proud to be joined by my guest, Anabely Lopes, and @RepJeffries, at the #SOTU. 

@HouseDemocrats and @POTUS have accomplished so much in the last two years, but the work isn't done. 

We must finish the job and protect reproductive rights for all women.
